  const [text, setText] = useState()
  const [isSearching, setIsSearching] = useState(false)
  const [isSearched, setIsSearched] = useState(false)

  return (
    <div id="search" className="menu-item">
      <form>
        <textarea id="textArea"></textarea>
      </form>
    </div>
  )
}

